// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract RockPaperScissors {
    // Constants
    uint256 public constant MIN_BET = 100000000000000; // 0.0001 tBNB
    uint256 public constant REVEAL_TIMEOUT = 86400; // Timeout in seconds (adjust as needed)

    // State variables
    address public player1;
    address public player2;
    bytes32 public encryptedMove1;
    bytes32 public encryptedMove2;
    string public clearMove1;
    string public clearMove2;
    uint256 public betAmount;
    uint256 public contractBalance;

    // Constructor to set the contract creator as player1
    constructor() {
        player1 = msg.sender;
    }

    // Modifier to check if a player is registered
    modifier onlyRegisteredPlayer(address player) {
        require(player == player1 || player == player2, "Player is not registered");
        _;
    }

    // Modifier to check if a player's move has been revealed
    modifier moveNotRevealed(bytes32 encryptedMove) {
        require(encryptedMove != bytes32(0), "Move has already been revealed");
        _;
    }

    // Register a player
    function register() external payable {
        require(msg.value >= MIN_BET, "Insufficient bet amount");
        require(player1 == address(0) || player2 == address(0), "Both players are already registered");
        
        if (player1 == address(0)) {
            player1 = msg.sender;
        } else {
            player2 = msg.sender;
        }
        betAmount = msg.value;
        contractBalance += msg.value;
    }

    // Submit an encrypted move
    function play(bytes32 encrMove) external onlyRegisteredPlayer(msg.sender) {
        require(encryptedMove1 == bytes32(0) || encryptedMove2 == bytes32(0), "Both players have already submitted their moves");
        if (msg.sender == player1) {
            encryptedMove1 = encrMove;
        } else {
            encryptedMove2 = encrMove;
        }
    }

    // Reveal a move and password
    function reveal(string memory clearMove, string memory password) external onlyRegisteredPlayer(msg.sender) moveNotRevealed(getPlayerEncryptedMove(msg.sender, password)) {
        if (msg.sender == player1) {
            require(keccak256(abi.encodePacked(clearMove)) == encryptedMove1, "Invalid move or password");
            clearMove1 = clearMove;
        } else {
            require(keccak256(abi.encodePacked(clearMove)) == encryptedMove2, "Invalid move or password");
            clearMove2 = clearMove;
        }

        if (bothRevealed()) {
            determineWinner();
        }
    }

    // Function to determine the winner and send rewards
    function determineWinner() internal {
        require(bothRevealed(), "Both players have not revealed their moves yet");
        
        // Implement your logic to determine the winner (e.g., Rock-Paper-Scissors rules)
        // Set the winner and handle rewards
        address payable winner;
        if (isPlayer1Winner()) {
            winner = payable(player1);
        } else if (isPlayer2Winner()) {
            winner = payable(player2);
        } else {
            // Draw, refund both players
            payable(player1).transfer(betAmount);
            payable(player2).transfer(betAmount);
            resetGame();
            return;
        }

        winner.transfer(contractBalance);
        resetGame();
    }

    // Function to check if both players have revealed their moves
    function bothRevealed() public view returns (bool) {
        return (bytes(clearMove1).length > 0 && bytes(clearMove2).length > 0);
    }

    // Function to check if player1 is the winner
    function isPlayer1Winner() internal pure returns (bool) {
        // Implement your winning condition logic here
        // For example, rock beats scissors, etc.
        return false; // Placeholder, replace with your logic
    }

    // Function to check if player2 is the winner
    function isPlayer2Winner() internal pure returns (bool) {
        // Implement your winning condition logic here
        // For example, rock beats scissors, etc.
        return false; // Placeholder, replace with your logic
    }

    // Function to reset the game state
    function resetGame() internal {
        player1 = address(0);
        player2 = address(0);
        encryptedMove1 = bytes32(0);
        encryptedMove2 = bytes32(0);
        clearMove1 = "";
        clearMove2 = "";
        betAmount = 0;
        contractBalance = 0;
    }

    // Helper function to generate the hash of the player's move and password
    function getPlayerEncryptedMove(address player, string memory password) internal pure returns (bytes32) {
        return keccak256(abi.encodePacked(player, password));
    }

    // Get the contract balance
    function getContractBalance() external view returns (uint256) {
        return address(this).balance;
    }

    // Get the player ID (1, 2, or 0 if not registered)
    function whoAmI() external view returns (uint256) {
        if (msg.sender == player1) {
            return 1;
        } else if (msg.sender == player2) {
            return 2;
        } else {
            return 0;
        }
    }

    // Check if both players have played
    function bothPlayed() external view returns (bool) {
        return (player1 != address(0) && player2 != address(0));
    }

    // Get the remaining time for move revelation
    function revealTimeLeft() external pure returns (uint256) {
        // Implement a timer mechanism here based on your requirements
        // You can use block.timestamp for timing
        return REVEAL_TIMEOUT;
    }
}

